import React, { useState } from 'react';
import { motion } from 'framer-motion';

function RegisterPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');

  const inputVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0, transition: { duration: 0.5 } },
  };

  return (
    <div className="min-h-screen flex flex-col justify-center items-center bg-purple-100">
      <div className="mb-8">
        <img src="/logo2.png" alt="Rajalakshmi Engineering College" className="w-64" />
      </div>
      <div className="bg-purple-200 p-6 rounded-lg shadow-md max-w-md w-full mx-auto">
        <h1 className="text-2xl font-bold mb-4 text-purple-900 text-center">Register Page</h1>
        <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </motion.div>
        <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </motion.div>
        <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </motion.div>
        <motion.div initial="hidden" animate="visible" variants={inputVariants} className="mb-4">
          <input
            type="text"
            placeholder="Phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            className="w-full p-2 border border-purple-300 rounded bg-purple-50 focus:outline-none focus:border-purple-500"
          />
        </motion.div>
      </div>
    </div>
  );
}

export default RegisterPage;
